import React, {Component} from 'react';
import PropTypes from 'prop-types';
import login from '../api/api';

class Login extends Component {
  handleLogin() {
    login();
  }

  render () {
    return (
      <div id="login">
        <button onClick={this.handleLogin}>Login</button>
      </div>
    );
  }
}

export default Login;
